import React from 'react';
import './NavBar .css'

function NavBar() {
    return (
        <nav className='nav'>
            <a href="#r">Profile</a>
            <div></div>
            <a href="#r">Messages</a>
            <div></div>
            <a href="#r">News</a>
            <div></div>
            <a href="#r">Music</a>
            <div></div>
            <a href="#r">Settings</a>
        </nav>
    )
}

export default NavBar;
